      <div className="Tasks">
           <p>{this.props.taskName}</p>
          <div className="Card">
            <div className="Task">
            Today  
            </div>
            <div className="Task">
            Tomorrow
            </div>
            <div className="Task">
            Someday
            </div>
          </div>

      </div>
    );
  }
}

export default Tasks;
